4707,0.00010015022533804707,0.00010015022533804707,0.0003004506760140302,0.00020030045067598312,0.0011016524787180737,0.0003004506760140302,0.00020030045067598312,0.00010015022533804707,0.001402103154732104,0.001402103154732104,0.001402103154732104,0.001402103154732104,0.001402103154732104,0.0011016524787180737,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.0006009013520280604,0.00020030045067598312,0.00010015022533804707,0.00020030045067598312,0.00020030045067598312,0.00020030045067598312,0.00020030045067598312,0.00010015022533804707,0.00010015022533804707]},"selected":{"id":"1501"},"selection_policy":{"id":"1500"}},"id":"1074","type":"ColumnDataSource"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 358.26 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 8191 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 43681.93 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 655.94 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 16.14 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 6.22 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://137.138.63.42:38014 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\nimport argparse\ndef dimuonSpectrum(df):\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\n        \"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\n        \"Dimuon_mass\",\n        \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\n        \"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    # Create canvas for plotting\n    ROOT.gStyle.SetOptStat(0)\n    ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx()\n    c.SetLogy()\n\n    watch = ROOT.TStopwatch()\n    hist.GetValue() # triggers the event loop\n    elapsed = watch.RealTime()\n    print(\"Event Loop =\", elapsed)\n    file_out = open('../../distrdf_timestamps.out', 'a')\n    file_out.write(\"\\nEvent Loop={}s\\n\".format(elapsed))\n    file_out.close()\n\n    # Draw histogram\n    hist.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\")\n    hist.GetXaxis().SetTitleSize(0.04)\n    hist.GetYaxis().SetTitle(\"N_{Events}\")\n    hist.GetYaxis().SetTitleSize(0.04)\n    hist.SetStats(False)\n    hist.Draw()\n\n    # Draw labels\n    label = ROOT.TLatex()\n    label.SetTextAlign(22)\n    label.DrawLatex(0.55, 3.0e4, \"#eta\")\n    label.DrawLatex(0.77, 7.0e4, \"#rho,#omega\")\n    label.DrawLatex(1.20, 4.0e4, \"#phi\")\n    label.DrawLatex(4.40, 1.0e5, \"J/#psi\")\n    label.DrawLatex(4.60, 1.0e4, \"#psi'\")\n    label.DrawLatex(12.0, 2.0e4, \"Y(1,2,3S)\")\n    label.DrawLatex(91.0, 1.5e4, \"Z\")\n    label.SetNDC(True)\n    label.SetTextAlign(11)\n    label.SetTextSize(0.04)\n    label.DrawLatex(0.10, 0.92, \"#bf{CMS Open Data}\")\n    label.SetTextAlign(31)\n    label.DrawLatex(0.90, 0.92, \"#sqrt{s} = 8 TeV, L_{int} = 11.6 fb^{-1}\")\n\n    # Save Canvas to image\n    c.SaveAs(\"dimuonSpectrum.png\")\n\n\nif __name__ == '__main__':\n    parser = argparse.ArgumentParser()\n    parser.add_argument(\"-c\", \"--cores\", type=int, default=32)\n    parser.add_argument(\"-N\", \"--Nodes\", type=int, default=1)\n    parser.add_argument(\"-f\", \"--files\", type=int, default=100)\n    parser.add_argument(\"-p\", \"--pts\", type=int, default=400)\n    parser.add_argument(\"-r\", \"--runs\", type=int, default=3)\n    args = parser.parse_args()\n\n    cluster = SLURMCluster(memory='{}g'.format(16*args.cores), processes=args.cores,\n                            cores=args.cores, queue='photon', local_directory='/tmp/ikabadzh',\n                            header_skip=['-n 1'], #asynchronous = True,\n                            job_extra=['--ntasks-per-node=1', '--exclusive'])\n    cluster.scale(jobs=args.Nodes)\n    #await cluster\n    client = Client(cluster)\n    #await client\n    client.wait_for_workers(min(args.cores*args.Nodes, 128), 160)\n    import ROOT\n    ROOT.gROOT.SetBatch(True)\n    RDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, args.files+1)]\n    df = RDataFrame(\"Events\", filelist, npartitions=(args.pts), daskclient=client) \n    for r in range(args.runs): \n        with performance_report(filename=\"dask-report_{}.html\".format(r)):\n            dimuonSpectrum(df)\n \n\n\n#if __name__ == '__main__':\n    #filelist = [\"/hpcscratch/user/ikabadzh/works/BENCH2/input_files/dimuon/f{}.root\".format(i) for i in range(1,1001)]\n    #loop = asyncio.get_event_loop()\n    #loop.run_until_complete(main())\n    #loop.close()\n    #main()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"tools":[{"id":"1056"},{"id":"1057"},{"id":"1058"},{"id":"1059"},{"id":"1072"}]},"id":"1061","type":"Toolbar"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1069","type":"Quad"},{"attributes":{"child":{"id":"1400"},"title":"Scheduler Logs"},"id":"1410","type":"Panel"},{"attributes":{},"id":"1046","type":"LinearScale"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Filename:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@filename&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Line number:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@line_number&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Line:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@line&lt;/span&gt;\n
